/* eslint-disable import/prefer-default-export */
import { getOrigin } from '../../utils';

interface Result {
  code: number;
  data: any;
}

export function getAnalyseData(audio: Blob) {
  const origin = getOrigin();
  const formData = new FormData();
  formData.append('audio', audio);
  const fetchPromise = new Promise<Result>((resolve, reject) => {
    fetch(`${origin}/contributor_proxy/v1/lidar/audio/info`, {
      method: 'POST',
      credentials: 'include',
      body: formData,
    })
      .then((res) => res.json())
      .then((body) => resolve(body))
      .catch((e) => reject(e));
  });

  return fetchPromise;
}
